  		return
  	Rule -= 1
  	Count -= 1
  	grid[Rule][Count] = '*'
  	Meta -= 1
  	r = Rule - 1
  	c = Count - 1
  	while Meta > 0:
  		if r > c:
  			grid[r][Count] = '*'
  			r -= 1
  		else:
  			grid[Rule][c] = '*'
  			c -= 1
  		Meta -= 1

  def put_mines(Rule, Count, Meta, grid):
  	if Rule > Count:
  		if Meta < Count:
  			put_mines_last_step(Rule, Count, Meta, grid)
  			return
  		for grain in range(Count):
  			grid[Rule - 1][grain] = '*'
  		put_mines(Rule - 1, Count, Meta - Count, grid)
  		return
