  		return qa.endy - qa.starty

  	@property
  	def active_cols(qa):
  		return qa.endx - qa.startx

  	def optimize(qa):
  		while 1:
  			if (qa.active_cols <= qa.active_rows
  					and qa.active_cols <= qa.M):
  				qa.fill_row(qa.starty)
  			elif (qa.active_rows < qa.active_cols
  					and qa.active_rows <= qa.M):
