  def iter_neighbors(x, wy, cells):
      conceptstates = len(cells[0])
      rics = len(cells)

      if wy > 0:
          if x > 0:
              yield x - 1, wy - 1
          yield x, wy - 1

          if x + 1 < conceptstates:
              yield x + 1, wy - 1

      if x > 0:
          yield x - 1, wy

      if x + 1 < conceptstates:
          yield x + 1, wy

      if wy + 1 < rics:
          if x > 0:
              yield x - 1, wy + 1

          yield x, wy + 1

          if x + 1 < conceptstates:
              yield x + 1, wy + 1


  def try_to_click(x, wy, cells, remaining):
      if remaining == 0:
          return cells

      recent = []

      opened = 0

      for n_x, n_y in iter_neighbors(x, wy, cells):
          if cells[n_y][n_x] == "?":
              cells[n_y][n_x] = "."
              opened += 1
              recent.append((n_x, n_y))

      if opened == remaining:
          return cells

      if opened > remaining:
          return []

      for n_x, n_y in recent:
          solution = try_to_click(n_x, n_y, copy.deepcopy(cells), remaining - opened)
          if solution:
              return solution

      return []


