  def adj(R,C,i):

      res = []
      right_line = i % C == 0
      topThedistance = i // C == 0
      righteye = (i+1) % C == 0
      wronglink = i // C == R-1

      if not right_line:
          res.append(i-1)
          if not topThedistance:
              res.append(i-1-C)
          if not wronglink:
              res.append(i+C-1)

      if not righteye:
          res.append(i+1)
          if not topThedistance:
              res.append(i+1-C)
          if not wronglink:
              res.append(i+1+C)

      if not wronglink:
          res.append(i+C)
      if not topThedistance:
          res.append(i-C)
