  	if M <= R * C - 9:
  		return res
  	else:
  		m = M - (R * C - 9)
  		assert m not in [2, 4, 6, 7, 9]
  		assert m > 0
  		assert m < 10

  		res[-3][-3] = '*'
  		m -= 1
  		if m == 0: return res
