      for row in board:
        retval = retval + "
" + "".join(row)

      return retval

    def executeTest(self, temp):
      """
        Run a test and return output.
      """

      (R,C,M) = temp

      spaces = R * C
      blanks = spaces - M

      if (blanks <= 0):
        return "Impossible"

      board = [['.' for x in range(C)] for y in range(R)]

      board[R-1][C-1] = "c"

      badposition=[]
      positions=[]

      for x in xrange(C):
        for y in xrange(R):
          if (x == (C-1)) and (y == (R-1)):
            continue
          if (x == (C-1)) and (y == (R-2)):
            badposition.append((x,y))
            continue
          if (x == (C-2)) and (y == (R-1)):
            badposition.append((x,y))
            continue
          if (x == (C-2)) and (y == (R-2)):
            badposition.append((x,y))
            continue

          positions.append((x,y))

      positions.reverse()

      for x in badposition:
        positions.insert(0, x)

      ms = M

      while (ms > 0):
        if len(positions) <= 0:
          return "Impossible"

        pos = positions.pop()
        (x,y) = pos

        if (board[y][x] != "."):
          return "Impossible"

        board[y][x] = '*'
        ms = ms - 1

      mines = sum([x.count('*') for x in board])

      if (mines != M):
        return "Impossible"

      if (blanks > 1):
        if (R > 1):
          if board[R - 2][C - 1] == "*":
            return "Impossible"

        if (C > 1):
          if board[R - 1][C - 2] == "*":
            return "Impossible"

        if (R > 1) and (C > 1):
          if board[R - 2][C - 2] == "*":
            return "Impossible"

